import { Container, Jumbotron } from 'react-bootstrap';
import styled from 'styled-components';

const Styles = styled.div`

background: #d65a31;

.adress {
  margin: auto;
}
`

function Contact() {
  return (
    <Styles id="contact">
      <SectionHeader name="Contact" />
      <div className="adress">
        <h1>Barber Andrew</h1>
        <h1>Orzechowa 50</h1>
        <h1>50-540 Wroc≈Çaw</h1>
      </div>
    </Styles>
  );



}

export default Contact;
